script: |
  super -f tsv -I q772.sql | sort > q772.out

vector: true

inputs:
  - name: q772.sql
    data: |
      SELECT ( + 74 ) AS col1, - COUNT ( * ) AS col0 FROM tab0 AS cor0 WHERE NOT + ( - 98 ) + + col1 NOT BETWEEN + col2 AND 68 + + ( + col0 ) + - 36 * + 70 + - + 19;
  - name: tab0

outputs:
  - name: q772.out
    data: |
      74	0
